import React from 'react';
import { BrowserRouter, Switch, Route } from 'react-router-dom';
import Home from './home';
import Test from './test';

const Main = () => (
    <BrowserRouter>
        <Switch>
            <Route exact path ='/' component = { Home } />
            <Route path ='/test' component = { Test } />
        </Switch>
    </BrowserRouter>
)

export default Main;
